
CREATE TABLE public.precios (
    id bigint NOT NULL,
    producto_id bigint NOT NULL,
    precio integer NOT NULL,
    costo integer NOT NULL,
    catalogo_id bigint NOT NULL,
    created_at timestamp without time zone NOT NULL,
    updated_at timestamp without time zone NOT NULL
);


ALTER TABLE public.precios OWNER TO erp;

CREATE SEQUENCE public.precios_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER TABLE public.precios_id_seq OWNER TO erp;

ALTER SEQUENCE public.precios_id_seq OWNED BY public.precios.id;

ALTER TABLE ONLY public.precios ALTER COLUMN id SET DEFAULT nextval('public.precios_id_seq'::regclass);




SELECT pg_catalog.setval('public.precios_id_seq', 982, true);

ALTER TABLE ONLY public.precios
    ADD CONSTRAINT precios_pkey PRIMARY KEY (id);


CREATE INDEX index_precios_on_catalogo_id ON public.precios USING btree (catalogo_id);
ALTER TABLE ONLY public.precios
    ADD CONSTRAINT fk_precio_categoria
        FOREIGN KEY (catalogo_id) REFERENCES public.catalogos(id);

CREATE INDEX index_precios_on_productos ON public.precios USING btree (producto_id);
ALTER TABLE ONLY public.precios
    ADD CONSTRAINT fk_precio_producto 
        FOREIGN KEY (producto_id) REFERENCES public.productos(id);




-- triggers
-- trigger para preparar el update
CREATE OR REPLACE FUNCTION precios_insert_prepara() 
   RETURNS TRIGGER 
   LANGUAGE PLPGSQL
AS $$
BEGIN
	NEW.created_at = now();
	NEW.updated_at = now();
    RETURN NEW;
END;
$$;

CREATE TRIGGER insert_prepara
    BEFORE INSERT ON precios
    FOR EACH ROW
    EXECUTE FUNCTION precios_insert_prepara();

-- trigger para preparar el update
CREATE OR REPLACE FUNCTION precios_update_prepara() 
   RETURNS TRIGGER 
   LANGUAGE PLPGSQL
AS $$
BEGIN
	NEW.updated_at = now();
    RETURN NEW;
END;
$$;

CREATE TRIGGER update_prepara
    BEFORE UPDATE ON precios
    FOR EACH ROW
    EXECUTE FUNCTION precios_update_prepara();
